import React from "react";
// import {
//     BrowserRouter as Link
// } from "react-router-dom";
import "./App.css";

export default function SignUp() {
  return (
    <div class="login-header">
      <h2>Sign Up</h2>
      <form method="post">
        <input
          id="login-box"
          type="username"
          name="uname"
          placeholder="new username"
          required
        ></input>
        <br />
        <input
          id="login-box"
          type="password"
          name="pwd"
          placeholder="new password"
          required
        ></input>
        <br />
        <button type="submit">Sign Up</button>
      </form>
    </div>
  );
}
